import "./R5c3Copy.css";

const R5c3Copy = ({ onClose }) => {
  return (
    <div className="r5c3-copy-div">
      <div className="r5c3-content-div">
        <span className="r5c3-content-txt-span">
          <p className="vehiclegarbage-truck-2">Vehicle:Garbage Truck 2</p>
          <p className="vehiclegarbage-truck-2">Sáng: Route1</p>
          <p className="chiu-mcp-26">Chiều: MCP 2</p>
        </span>
      </div>
      <div className="r5c3-text-div">28</div>
    </div>
  );
};

export default R5c3Copy;
